
syntax = "proto3";

package name_clash;

message Protobuf {
  int64 Protobuf = 1;
  int64 Ocaml_protoc_plugin = 2;
  int64 make = 3;
  int64 t = 4;
  int64 to_proto = 5;
  int64 from_proto = 6;
  int64 Runtime = 7;
  int64 name = 8;
}
message Ocaml_protoc_plugin {
  int64 Protobuf = 1;
  int64 Ocaml_protoc_plugin = 2;
}
message OcamlProtocPlugin {
  int64 Protobuf = 1;
  int64 Ocaml_protoc_plugin = 2;
}
message Base {
  int64 Protobuf = 1;
  int64 Ocaml_protoc_plugin = 2;
}
message Pervasives {
  int64 Protobuf = 1;
  int64 Ocaml_protoc_plugin = 2;
}
message Stdlib {
  int64 Protobuf = 1;
  int64 Ocaml_protoc_plugin = 2;
}
message StdLabels {
  int64 Protobuf = 1;
  int64 Ocaml_protoc_plugin = 2;
}
message Enum {
  int64 enum = 1;
}
message Enum1 {
  int64 Enum1 = 1;
}
message struct {
  int64 struct = 1;
}
message end {
  int64 End = 1;
}
message basic {
  int64 Basic = 1;
  int64 Int64 = 2;
}
message _Enum {
  int64 i = 1;
}
message _enum {
  int64 i = 1;
}

message equal {
  int64 equal = 1;
}

message enum_clash {
  int64 name_one = 1;
  oneof NameOne { int64 name_two = 2; }
  oneof Name_one { int64 name_three = 3; }
}

message not_set {
  int64 not_set = 1;
}

message not_set2 {
    oneof not_set { int64 not_set2 = 1; };
}

message not_set3 {
    oneof not_set3 { int64 not_set = 1; };
}
